import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login';
import RForm from './components/RForm'; // Ensure the path is correct to RForm component

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route path="/resume-form" component={RForm} />
      </Switch>
    </Router>
  );
};

export default App;
